import React from "react";
import { useRef } from "react";

function ProfilePage({ logedUser }) {
  console.log(logedUser);
  const inPick = useRef();

  function changePic() {}
  return (
    <div>
      <div>
        <img src={logedUser.img} alt="" />
        <div>{logedUser.email}</div>
      </div>
      <div>
        <input ref={inPick} type="text" placeholder="new image URL" />
        <button onClick={changePic}>Change Picture</button>
      </div>
    </div>
  );
}

export default ProfilePage;
